import './App.css';

import {HOME} from "./mainpage/Page";
import {Route} from "react-router-dom";
import { Link } from 'react-router-dom';



function App() {
  return (
    <div>
      <HOME/>

        <Route path="/" component={HOME}/>
    </div>
  );
}


export default App;
